import React from 'react';
import ReactDOM from 'react-dom';

const API = "http://localhost:5000/weather"
function fetchJSON(url){
    console.log("Fetching Weather from homepoint");
    return fetch(url)
}

const weather = fetchJSON(API)

weather.then(response => {
    return response.json();
})
.then(function(newWeather){
    let returned = (JSON.stringify(newWeather));
    let parsed = JSON.parse(returned);
})

let element = <div id="weatherWidget"> 
<span className="hidden" id="CloudsIcon"><i className="fas fa-cloud fa-7x"></i></span>
<span className="hidden" id="ClearIcon"><i className="fas fa-sun fa-7x"></i></span>
<span className="hidden" id="RainIcon"><i className="fas fa-cloud-rain-7x"></i></span>

<h1>{parsed.temp}</h1>
<small>At home</small>
</div>;

ReactDOM.render(element, document.getElementById('weatherCol'))
